import{_ as e,o as t,c as n,a as i}from"./app.8d96fb22.js";const g=JSON.parse('{"title":"Manifest V2 support timeline","description":"","frontmatter":{},"headers":[],"relativePath":"chromedocs/Migrate from Manifest V2 to Manifest V3/Manifest V2 support timeline - Chrome Developers.md","lastUpdated":1679926139000}'),o={name:"chromedocs/Migrate from Manifest V2 to Manifest V3/Manifest V2 support timeline - Chrome Developers.md"},s=i('<h1 id="manifest-v2-support-timeline" tabindex="-1">Manifest V2 support timeline <a class="header-anchor" href="#manifest-v2-support-timeline" aria-hidden="true">#</a></h1><p>Understand when Manifest V2 will stop working for extensions</p><p>Published on Thursday, September 23, 2021 \u2022 Updated on Wednesday, November 30, 2022</p><p>As Manifest V3 approaches full feature parity with Manifest V2, we&#39;ll be progressively phasing out Manifest V2. This page specifies the timetable for this deprecation and describes the meaning of each milestone.</p><p>![Summary of the Manifest V2 support timeline.](./Manifest V2 support timeline - Chrome Developers_files/OfabxpaX9YMUoyBWJWMX.png)</p><p>Summary of the Manifest V2 support timeline.</p><p>Check this page for any updates and for more specific dates as these milestones get closer.</p><p><strong>Chrome Web Store<br> behavior changes</strong></p><p><strong>Chrome Browser<br> behavior changes</strong></p><p><strong>January\xA017, 2022</strong></p><ul><li>Existing Manifest V2 extensions can no longer be changed from \u201CPrivate\u201D to &quot;Public&quot; or &quot;Unlisted&quot;</li></ul><p><em>no change</em></p><p><strong>June\xA02022</strong></p><ul><li>Chrome Web Store stops accepting new Manifest V2 extensions with visibility set to \u201CPublic&quot; or &quot;Unlisted\u201D</li></ul><p><em>no change</em></p><p><strong>January\xA02023</strong></p><ul><li><p>Manifest V3 will become a prerequisite for the <a href="https://blog.google/products/chrome/find-great-extensions-new-chrome-web-store-badges/" target="_blank" rel="noreferrer">Featured badge</a>.</p></li><li><p>Enterprise policy can let Manifest V2 extensions run on Chrome deployments <a href="https://support.google.com/chrome/a/answer/9296680?hl=en" target="_blank" rel="noreferrer">within an organization</a>.</p></li><li><p>Staring in <strong>Chrome 112</strong>, Chrome may run experiments to turn off support for Manifest V2 extensions in Canary, Dev, and Beta channels.</p></li></ul><p><strong>June\xA02023</strong></p><ul><li><p>All existing Manifest V2 items with visibility set to Public at that time will have their visibility changed to Unlisted.</p></li><li><p>Starting in June in <strong>Chrome 115</strong>, Chrome may run experiments to turn off support for Manifest V2 extensions in all channels, including stable channel.</p></li></ul><p><strong>January\xA02024</strong></p><ul><li><p>Chrome Web Store stops accepting updates to existing Manifest V2 extensions</p></li><li><p>Following the expiration of the Manifest V2 enterprise policy, the Chrome Web Store will remove all remaining Manifest V2 items from the store.</p></li><li><p>Manifest V2 enterprise policy expires. This means Chrome will stop running Manifest V2 extensions, even ones installed using <code>ExtensionInstallForcelist</code>.</p></li></ul><p>Updated on Wednesday, November 30, 2022 \u2022 <a href="https://github.com/GoogleChrome/developer.chrome.com/blob/main/site/en/docs/extensions/mv3/mv2-sunset/index.md" target="_blank" rel="noreferrer">Improve article</a></p>',22),r=[s];function a(p,l,m,h,c,f){return t(),n("div",null,r)}const d=e(o,[["render",a]]);export{g as __pageData,d as default};
